// Server configuration
const SERVER_IP = 'localhost';
const SERVER_PORT = '8000';

const config = {
    API_URL: process.env.REACT_APP_API_URL || `http://${SERVER_IP}:${SERVER_PORT}`,
    SERVER_IP: SERVER_IP,
    SERVER_PORT: SERVER_PORT
};

export default config;
